import '../assets/scss/slider.scss'

const Slider = () => {
  return (
    <div className="slider_div">
        <div className="left_text_div">
            <div className="text_top">
                <h2 className='title'>2022 개정</h2>
                <h2 className='title'>교육과정 교과서</h2>
